def readScore():
    records = {}
    with open("datafile/records.csv", "r") as f:
        tmp = f.readlines()
        for item in tmp:
            arr = item.split(" ")
            key = arr[0]+"_"+arr[1]
            if key in records:
                records[key].append(arr[2])
            else:
                records[key] = [arr[2]]
    return records

def getScoreByID(myid, problemid):
    global question
    global scoretable
    sid = myid[4:len(myid)].strip("0")
    pid = question[problemid][0]
    t = sid+"_"+str(pid)
    if t in scoretable:
        return scoretable[t]
    else:
        return []

def readProblemOverNum(num):
    global question
    records = {}
    with open("datafile/records.csv", "r") as f:
        tmp = f.readlines()
        for item in tmp:
            arr = item.split(" ")
            # key = arr[0]+"_"+arr[1]
            # print(arr[1])
            # print(arr[1] in question)
            if arr[1] in question:
                pid = question[arr[1]][0]
                if pid in records:
                    records[pid] += 1
                else:
                    records[pid] = 1
    records = sorted(records.items(), key = lambda kv:(kv[1], kv[0]), reverse=True)
    tmprecords = []
    for i in records:
        if i[1] > 1000:
            tmprecords.append(i)
    return tmprecords

question = readquestion()
scoretable = readScore()
recentScore = readrecentrecords()
